Nixpkgs provides a workaround for mono-versioning conflicts, by using the override pattern . We can override the version of yaml to the one we want as follows: let sources = import ../sources.nix {}; nixpkgs = import sources.nixpkgs {}; hsLib = nixpkgs.haskell.lib; hsPkgs-original = nixpkgs.haskell.packages.ghc8102; hsPkgs = hsPkgs-original.override { overrides = hsPkgs-old: hsPkgs-new: { yaml = hsPkgs-new.callHackage "yaml" "0.11.3.0" {}; }; }; src = builtins.path { name = "haskell-project-src"; path = ../../haskell; filter = path: type: let basePath = builtins.baseNameOf path; in basePath != "dist-newstyle" ; }; project = hsPkgs.callCabal2nix "haskell-project" src;
in
hsPkgs.callPackage project {} Essentially, we refer to the original haskell package set provided as hsPkgs-original, and we call hsPkgs-original.override to produce a new package set hsPkgs with yaml overridden to 0.11.3.0. Using callHackage, we can fetch the version of yaml from the Hackage snapshot in nixpkgs. With that we can just provide the string "0.11.3.0" to specify the version that we want. Note however that this only works if the version can be found in the given Hackage snapshot, which may be outdated over time. An issue with overriding dependencies this way is that the override affects the entire Haskell package set. This means that all other Haskell packages that depend on yaml will also get 0.11.3.0 instead of 0.11.5.0. As a result, this may have the unintended ripple effect of breaking other Haskell packages that we depends on.

