{ "/nix/store/in40c5fl13ziqzds3wfg2ag7ax2xmq5l-greet-alice.drv": { ... "builder": "/nix/store/qdp56fi357fgxxnkjrwx1g67hrk775im-bash-4.4-p23/bin/bash", "args": [ "-e", "/nix/store/9krlzvny65gdc8s7kpb6lkx8cd02c25b-default-builder.sh" ], "env": { "buildInputs": "/nix/store/l6xy4qjr8x3ni16skfilw0fvnda13szq-greet", "builder": "/nix/store/qdp56fi357fgxxnkjrwx1g67hrk775im-bash-4.4-p23/bin/bash", ... "installPhase": "greet Alice > $out", "name": "greet-alice", ... "stdenv": "/nix/store/ajq5dfwn4hzlx1qf2xxwb6rj8a7s65nm-stdenv-linux", ... } }
} stdenv is also using bash as the builder, and have it evaluate the script at /nix/store/9krlzvny65gdc8s7kpb6lkx8cd02c25b-default-builder.sh. Let's see what's inside there: $ cat /nix/store/9krlzvny65gdc8s7kpb6lkx8cd02c25b-default-builder.sh
source $stdenv/setup
genericBuild So the magic is hidden inside $stdenv/setup, with the $stdenv variable set to /nix/store/ajq5dfwn4hzlx1qf2xxwb6rj8a7s65nm-stdenv-linux. We can open it and see what's inside. nix-shell $drv --run 'cat $stdenv/setup' There are quite a lot of shell scripts happening. If we search through the script, we can see that environment variables such as buildInputs, buildPhase, and installPhase are being referred inside $stdenv/setup. In other words, instead of having to figure how to setup various environment variables to work with various dependencies, $stdenv/setup provides a higher level abstraction of doing the setup for us. We just have to define the build inputs and steps that we need, and $stdenv/setup will fill in the missing pieces from us. In fact, $stdenv/setup is also being sourced when we enter a Nix shell of a stdenv derivation. From the nix-shell manual : The command nix-shell will build the dependencies of the specified derivation, but not the derivation itself. It will then start an interactive shell in which all environment variables defined by the derivation path have been set to their corresponding values, and the script $stdenv/setup has been sourced. This is useful for reproducing the environment of a derivation for development.
